import React from 'react'
import './Profile.css'
import Perfil from '../../img/perfil.jpg';

function Profile() {
  return (
    <div className="profile">
        <div className="image">
            <img src="Perfil" alt="perfil" />
        </div>
    </div>
  )
}

export default Profile
